using DriverLicenseTestBE.Models;
using DriverLicenseTestBE.Utils;
using DriverLicenseTestBE.ViewModels;
namespace DriverLicenseTestBE.Services
{
    public interface IAuthenticationService
    {
        public string Login(UserLoginVM model, out dynamic result);
        public string Register(UserRegisterVM model);
        //public string SendCode(CheckEmailVM request, out TimeOutMessageVM nocation);
    }
    public class AuthenticationService : IAuthenticationService
    {
        private readonly DriverLicenseTestContext _context;

        public AuthenticationService(DriverLicenseTestContext context)
        {
            _context = context;
        }

        #region Service
        public string Login(UserLoginVM model, out dynamic result)
        {
            result = null;
            try
            {
                var user = _context.Users.FirstOrDefault(u => u.Username == model.Username || u.Email == model.Username);
                if (user == null || !VerifyPassword(model.Password, user.PasswordHash)) return "Login failed";

                // Generate a new token
                var userToken = new UserToken
                {
                    IsRememberPassword = model.RememberMe, // Assuming you have a RememberMe property in your UserLoginVM
                    Token = Convert.ToBase64String(Guid.NewGuid().ToByteArray()),
                    ExpiredDate = DateTime.Now.AddHours(1), // Token expires in 1 hour
                    UserId = user.UserId
                };

                _context.UserTokens.Add(userToken);
                _context.SaveChanges();
                result = user;
            }
            catch (Exception ex)
            {
                return "An error occurred during login: " + ex.Message;
            }
            return "";
        }

        public string Register(UserRegisterVM model)
        {
            if (_context.Users.Any(u => u.Username == model.Username)) return $"Username {model.Username} already exists";
            if (_context.Users.Any(u => u.Email == model.Email)) return $"Email {model.Email} already exists";
            string passwordHash = Helper.HashPassword(model.Password);
            var user = new User
            {
                Username = model.Username,
                Email = model.Email,
                PasswordHash = passwordHash,
                FullName = model.FullName,
                AvatarUrl = defaultAvatar,
                CreatedAt = DateTime.Now,
                Roles = new List<Role> { _context.Roles.FirstOrDefault(r => r.RoleId == Constants.Constants.CUSTOMER_ROLE) }
            };
            _context.Users.Add(user);
            _context.SaveChanges();

            //var role = _context.Roles.FirstOrDefault(r => r.Name == "User");
            return "";
        }
        #endregion

        #region Helper
        private bool VerifyPassword(string password, string storedHash)
        {
            var hash = Helper.HashPassword(password);
            return hash == storedHash;
        }

        private string defaultAvatar = "data:image/png;base64,";
        #endregion
    }
}
